import {React}  from "react";


const Output = (props) => {
    let {value} = props
    return (
        <>
            <div>
                {
                    value.map((item,index) => {
                        return (
                            <div key={index}>
                                <li> {item}</li>  
                            </div>
                        )
                    })
                }
            </div>
        </>
    )

}


export default Output
